package com.estacioname.modelos;

public class Cajon {
	
	private int id,estado;

	public Cajon() {
		super();
		// TODO Auto-generated constructor stub
	}

	public Cajon(int id, int estado) {
		super();
		this.id = id;
		this.estado = estado;
	}

	public int getId() {
		return id;
	}

	public void setId(int id) {
		this.id = id;
	}

	public int getEstado() {
		return estado;
	}

	public void setEstado(int estado) {
		this.estado = estado;
	}
	
	

}
